Komedie / Horror
100 minuten

geregisseerd door Duane Journey
met Molly C. Quinn, Lara Flynn Boyle en Michael Welch

In de voorstad &quot;Pasadena&quot; woont een heks die tieners haar huis in lokt met een bijzondere soort marihuana. Dit om ze vervolgens te doden en op te eten om zo haar jeugd en schoonheid te behouden. Hansel neemt het samen met zijn zus Gretel op tegen de heks.



